  const [chosenLesson, setChosenLesson] = useState('');

  const lessons = ['Math', 'IT', 'Literature'];

  return (
    <div>
      <Select
        labelId="demo-simple-select-label"
        id="demo-simple-select"
        value={''}
        label="Quarter">
        {lessons.map((lesson) => {
          return <MenuItem value={lesson.toLowerCase()}>{lesson}</MenuItem>;
        })}
      </Select>
      StudentAvgChart
    </div>
  );
}
